import React from "react";
import { Link } from "react-router-dom";
import Emailoutline from "../Emailoutline";
import Belloutline from "../Belloutline";
import Personoutline1 from "../Personoutline1";
import "./Frame1954.css";

function Frame1954(props) {
  const { ragrariansI5693135, frame1951, text15, emailoutlineProps, belloutlineProps, personoutline1Props } = props;

  return (
    <div className="frame-1954">
      <div className="ragrarians-i5693135 ibmplexsans-semi-bold-quarter-spanish-white-24px">{ragrariansI5693135}</div>
      <div className="frame-1973">
        <Emailoutline layer22Props={emailoutlineProps.layer22Props} />
        <Belloutline vector={belloutlineProps.vector} vector2={belloutlineProps.vector2} />
        <Link to="/10-4-my-personals-1">
          <div className="frame-1951">
            <Link to="/10-4-my-personals-1" onClick={window.event.stopPropagation()}>
              <img className="frame-1951-1" src={frame1951} />
            </Link>
          </div>
        </Link>
      </div>
      <Link to="/10-1-my-dashboard">
        <div className="frame-28482">
          <Personoutline1
            vector={personoutline1Props.vector}
            vector2={personoutline1Props.vector2}
            vector3={personoutline1Props.vector3}
          />
          <div className="text-15 ibmplexsans-semi-bold-quarter-spanish-white-16px">{text15}</div>
        </div>
      </Link>
    </div>
  );
}

export default Frame1954;
